    <title>语文</title>
    <link rel="shortcut icon" href="../../../../img/favicon.png">
    <style>
        * {
            margin: 0;
            padding: 0;
            background-color: #f0f0f0;
        }

        li {
            list-style-type: none;
        }

        ul {
            position: absolute;
            left: calc(50% - 32%);
            top: 1rem;
            width: 64%;
            background-color: #efefef;
            border: 1px solid #ccc;
        }

        a h1:hover {
            box-shadow: 8px 8px 16px 1px rgba(0, 0, 0, 0.3);
        }

        a {
            cursor: pointer;
            text-decoration: none;
            color: #000;
        }

        li a h1 {
            box-sizing: border-box;
            display: block;
            background-color: #fff;
            width: 96%;
            margin: 20px auto;
            padding-left: 20px;
            border: 1px solid #666;
            border-radius: 2px;
            transition: all 0.3s;
        }

        a:visited {
            color: initial;
        }

        canvas {
            position: absolute;
            top: 0;
            left: 0;
        }

        .bgc {
            position: absolute;
            top: 60%;
            background-color: transparent;
        }
    </style>
